import './App.css';

import { BrowserRouter, Switch , Routes, Route} from 'react-router-dom';

import ShowProducto from './components/ShowProducto';
import React from 'react';
// import login

// import{}from

function App() {
  return (
    <div className="App">
      <React.Fragment>

      </React.Fragment>
      <BrowserRouter>
        <Routes>
          <Route path='/'  element={<ShowProducto/> } />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
